function SubHeaderInfo(props) {
  return (
    <div>
      <h2>Welcome to the Pokedex.</h2>
      <h4>
        Your own team of pokemon by clicking, or by searching for their name or
        id.
      </h4>
    </div>
  );
}
export default SubHeaderInfo;
